import 'dart:convert';

import 'package:flutter_test/flutter_test.dart';
import 'package:mocktail/mocktail.dart';
import 'package:x50pay/common/models/entry/entry.dart';
import 'package:x50pay/providers/entry_provider.dart';
import 'package:x50pay/repository/repository.dart';

class MockRepo extends Mock implements Repository {}

final mockRepo = MockRepo();

void main() {
  void arrangeGetEntryReturnsData() {
    when(mockRepo.getEntry).thenAnswer((_) async {
      const rawEntry =
          r'''{"message":"done","code":200,"gr2":[126.33,275,2,"250","05/26 - 2","07/30","","data:image/webp;base64,",true,45.93,15,25,0,0],"rqc":[],"evlist":[{"_id":{"$oid":"6661b3989be587266cc34310"},"name":"\u901f\u901f\u5237\u6a5f","which":[],"describe":"\u5168\u984d\u4ed8\u8cbb Point \u904a\u73a9 4 \u9053\u9001\u904a\u73a9\u5238 1 \u5f35\uff08\u9694\u65e5\u767c\u653e\uff09[\u4e0a\u9650 8 \u5f35]","count":"3","start":{"$date":"2024-06-06T16:00:00Z"},"end":{"$date":"2024-06-07T15:59:59Z"},"point":false,"value":0,"limit":8,"countday":"1","id":"240607","ticMid":[],"sid":"0","ticdis":"\u5168\u5e97\u53ef\u7528"}],"giftlist":{"gift":false}}''';
      return EntryModel.fromJson(json.decode(rawEntry));
    });
  }

  void arrangeGetEntryReturnsNull() {
    when(mockRepo.getEntry).thenAnswer((_) async {
      return null;
    });
  }

  void arrangeGetEntryReturnsErrorCode() {
    when(mockRepo.getEntry).thenAnswer((_) async {
      return const EntryModel(
        message: 'error test',
        code: 404,
        gr2: [],
      );
    });
  }

  group('取得EntryModel', () {
    test('當成功取得EntryModel時，應該回傳true，且Entry 不等於Null', () async {
      arrangeGetEntryReturnsData();
      final entryProvider = EntryProvider(repo: mockRepo);
      final result = await entryProvider.checkEntry();
      expect(result, true);
      expect(entryProvider.entry, isNotNull);
    });

    test('當失敗取得EntryModel時，應該回傳false，且Entry 等於Null', () async {
      arrangeGetEntryReturnsNull();
      final entryProvider = EntryProvider(repo: mockRepo);
      var result = await entryProvider.checkEntry();
      expect(result, false);
      expect(entryProvider.entry, isNull);

      arrangeGetEntryReturnsErrorCode();
      result = await entryProvider.checkEntry();
      expect(result, false);
      expect(entryProvider.entry, isNull);
    });
  });
}
